package com.lxl.jc.pojo;

import java.util.Date;

public class Safe {
	private int said;
	private Date satime;
	private	String saa;
	private String sab;
	private String sac;
	private String sae;
	private String saf;
	private String sag;
	private String sad;
	public Safe() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Safe(int said, Date satime, String saa, String sab, String sac, String sae, String saf, String sag,
			String sad) {
		super();
		this.said = said;
		this.satime = satime;
		this.saa = saa;
		this.sab = sab;
		this.sac = sac;
		this.sae = sae;
		this.saf = saf;
		this.sag = sag;
		this.sad = sad;
	}
	public int getSaid() {
		return said;
	}
	public void setSaid(int said) {
		this.said = said;
	}
	public Date getSatime() {
		return satime;
	}
	public void setSatime(Date satime) {
		this.satime = satime;
	}
	public String getSaa() {
		return saa;
	}
	public void setSaa(String saa) {
		this.saa = saa;
	}
	public String getSab() {
		return sab;
	}
	public void setSab(String sab) {
		this.sab = sab;
	}
	public String getSac() {
		return sac;
	}
	public void setSac(String sac) {
		this.sac = sac;
	}
	public String getSae() {
		return sae;
	}
	public void setSae(String sae) {
		this.sae = sae;
	}
	public String getSaf() {
		return saf;
	}
	public void setSaf(String saf) {
		this.saf = saf;
	}
	public String getSag() {
		return sag;
	}
	public void setSag(String sag) {
		this.sag = sag;
	}
	public String getSad() {
		return sad;
	}
	public void setSad(String sad) {
		this.sad = sad;
	}
	
}
